import { TodoItem } from "./TodoItem";
import { CreateTodoButton } from "./CreateTodoButton";

function App() {
  return (
    <div className="App">
      <TodoCounter completed={16} total={20} />
      <TodoFilter />

      <TodoList>
        <TodoItem />
        <TodoItem />
        <TodoItem />
      </TodoList>

      <CreateTodoButton />
    </div>
  );
}
export default App;
